package com.welab.wefe.contract;

import org.fisco.bcos.sdk.abi.FunctionReturnDecoder;
import org.fisco.bcos.sdk.abi.TypeReference;
import org.fisco.bcos.sdk.abi.datatypes.*;
import org.fisco.bcos.sdk.abi.datatypes.generated.Int256;
import org.fisco.bcos.sdk.abi.datatypes.generated.tuples.generated.Tuple1;
import org.fisco.bcos.sdk.abi.datatypes.generated.tuples.generated.Tuple2;
import org.fisco.bcos.sdk.abi.datatypes.generated.tuples.generated.Tuple8;
import org.fisco.bcos.sdk.client.Client;
import org.fisco.bcos.sdk.contract.Contract;
import org.fisco.bcos.sdk.crypto.CryptoSuite;
import org.fisco.bcos.sdk.crypto.keypair.CryptoKeyPair;
import org.fisco.bcos.sdk.model.CryptoType;
import org.fisco.bcos.sdk.model.TransactionReceipt;
import org.fisco.bcos.sdk.model.callback.TransactionCallback;
import org.fisco.bcos.sdk.transaction.model.exception.ContractException;

import java.math.BigInteger;
import java.util.Arrays;
import java.util.Collections;
import java.util.List;

@SuppressWarnings("unchecked")
public class BillContract extends Contract {
    public static final String[] BINARY_ARRAY = {"", "", "", ""};

    public static final String BINARY = String.join("", BINARY_ARRAY);

    public static final String[] SM_BINARY_ARRAY = {"", "", "", ""};

    public static final String SM_BINARY = String.join("", SM_BINARY_ARRAY);

    public static final String[] ABI_ARRAY = {"[{\"constant\":true,\"inputs\":[{\"name\":\"id\",\"type\":\"string\"}],\"name\":\"selectById\",\"outputs\":[{\"name\":\"\",\"type\":\"int256\"},{\"name\":\"\",\"type\":\"string[]\"}],\"payable\":false,\"stateMutability\":\"view\",\"type\":\"function\"},{\"constant\":true,\"inputs\":[{\"name\":\"seq_no\",\"type\":\"string\"}],\"name\":\"isExist\",\"outputs\":[{\"name\":\"\",\"type\":\"bool\"}],\"payable\":false,\"stateMutability\":\"view\",\"type\":\"function\"},{\"constant\":true,\"inputs\":[{\"name\":\"seq_no\",\"type\":\"string\"}],\"name\":\"selectBySeqNo\",\"outputs\":[{\"name\":\"\",\"type\":\"int256\"},{\"name\":\"\",\"type\":\"string[]\"}],\"payable\":false,\"stateMutability\":\"view\",\"type\":\"function\"},{\"constant\":false,\"inputs\":[{\"name\":\"id\",\"type\":\"string\"},{\"name\":\"seq_no\",\"type\":\"string\"},{\"name\":\"member_id\",\"type\":\"string\"},{\"name\":\"model_id\",\"type\":\"string\"},{\"name\":\"algorithm\",\"type\":\"string\"},{\"name\":\"fl_type\",\"type\":\"string\"},{\"name\":\"my_role\",\"type\":\"string\"},{\"name\":\"created_time\",\"type\":\"int256\"}],\"name\":\"insert\",\"outputs\":[{\"name\":\"\",\"type\":\"int256\"}],\"payable\":false,\"stateMutability\":\"nonpayable\",\"type\":\"function\"},{\"constant\":true,\"inputs\":[{\"name\":\"member_id\",\"type\":\"string\"},{\"name\":\"model_id\",\"type\":\"string\"},{\"name\":\"startIndex\",\"type\":\"int256\"},{\"name\":\"endIndex\",\"type\":\"int256\"}],\"name\":\"selectByPage\",\"outputs\":[{\"name\":\"\",\"type\":\"int256\"},{\"name\":\"\",\"type\":\"string[]\"}],\"payable\":false,\"stateMutability\":\"view\",\"type\":\"function\"},{\"inputs\":[],\"payable\":false,\"stateMutability\":\"nonpayable\",\"type\":\"constructor\"}]"};

    public static final String ABI = String.join("", ABI_ARRAY);

    public static final String FUNC_SELECTBYID = "selectById";

    public static final String FUNC_ISEXIST = "isExist";

    public static final String FUNC_SELECTBYSEQNO = "selectBySeqNo";

    public static final String FUNC_INSERT = "insert";

    public static final String FUNC_SELECTBYPAGE = "selectByPage";

    protected BillContract(String contractAddress, Client client, CryptoKeyPair credential) {
        super(getBinary(client.getCryptoSuite()), contractAddress, client, credential);
    }

    public static String getBinary(CryptoSuite cryptoSuite) {
        return (cryptoSuite.getCryptoTypeConfig() == CryptoType.ECDSA_TYPE ? BINARY : SM_BINARY);
    }

    public Tuple2<BigInteger, List<String>> selectById(String id) throws ContractException {
        final Function function = new Function(FUNC_SELECTBYID,
                Arrays.<Type>asList(new org.fisco.bcos.sdk.abi.datatypes.Utf8String(id)),
                Arrays.<TypeReference<?>>asList(
                        new TypeReference<Int256>() {
                        },
                        new TypeReference<DynamicArray<Utf8String>>() {
                        }
                )
        );
        List<Type> results = executeCallWithMultipleValueReturn(function);
        return new Tuple2<BigInteger, List<String>>(
                (BigInteger) results.get(0).getValue(),
                convertToNative((List<Utf8String>) results.get(1).getValue()));
    }

    public Boolean isExist(String seq_no) throws ContractException {
        final Function function = new Function(FUNC_ISEXIST,
                Arrays.<Type>asList(new org.fisco.bcos.sdk.abi.datatypes.Utf8String(seq_no)),
                Arrays.<TypeReference<?>>asList(new TypeReference<Bool>() {
                })
        );
        return executeCallWithSingleValueReturn(function, Boolean.class);
    }

    public Tuple2<BigInteger, List<String>> selectBySeqNo(String seq_no) throws ContractException {
        final Function function = new Function(FUNC_SELECTBYSEQNO,
                Arrays.<Type>asList(new org.fisco.bcos.sdk.abi.datatypes.Utf8String(seq_no)),
                Arrays.<TypeReference<?>>asList(
                        new TypeReference<Int256>() {
                        },
                        new TypeReference<DynamicArray<Utf8String>>() {
                        }
                )
        );
        List<Type> results = executeCallWithMultipleValueReturn(function);
        return new Tuple2<BigInteger, List<String>>(
                (BigInteger) results.get(0).getValue(),
                convertToNative((List<Utf8String>) results.get(1).getValue()));
    }

    public TransactionReceipt insert(String id, String seq_no, String member_id, String model_id, String algorithm, String fl_type, String my_role, BigInteger created_time) {
        final Function function = new Function(
                FUNC_INSERT,
                Arrays.<Type>asList(new org.fisco.bcos.sdk.abi.datatypes.Utf8String(id),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(seq_no),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(member_id),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(model_id),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(algorithm),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(fl_type),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(my_role),
                        new org.fisco.bcos.sdk.abi.datatypes.generated.Int256(created_time)),
                Collections.<TypeReference<?>>emptyList());
        return executeTransaction(function);
    }

    public void insert(String id, String seq_no, String member_id, String model_id, String algorithm, String fl_type, String my_role, BigInteger created_time, TransactionCallback callback) {
        final Function function = new Function(
                FUNC_INSERT,
                Arrays.<Type>asList(new org.fisco.bcos.sdk.abi.datatypes.Utf8String(id),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(seq_no),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(member_id),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(model_id),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(algorithm),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(fl_type),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(my_role),
                        new org.fisco.bcos.sdk.abi.datatypes.generated.Int256(created_time)),
                Collections.<TypeReference<?>>emptyList());
        asyncExecuteTransaction(function, callback);
    }

    public String getSignedTransactionForInsert(String id, String seq_no, String member_id, String model_id, String algorithm, String fl_type, String my_role, BigInteger created_time) {
        final Function function = new Function(
                FUNC_INSERT,
                Arrays.<Type>asList(new org.fisco.bcos.sdk.abi.datatypes.Utf8String(id),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(seq_no),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(member_id),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(model_id),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(algorithm),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(fl_type),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(my_role),
                        new org.fisco.bcos.sdk.abi.datatypes.generated.Int256(created_time)),
                Collections.<TypeReference<?>>emptyList());
        return createSignedTransaction(function);
    }

    public Tuple8<String, String, String, String, String, String, String, BigInteger> getInsertInput(TransactionReceipt transactionReceipt) {
        String data = transactionReceipt.getInput().substring(10);
        final Function function = new Function(FUNC_INSERT,
                Arrays.<Type>asList(),
                Arrays.<TypeReference<?>>asList(new TypeReference<Utf8String>() {
                }, new TypeReference<Utf8String>() {
                }, new TypeReference<Utf8String>() {
                }, new TypeReference<Utf8String>() {
                }, new TypeReference<Utf8String>() {
                }, new TypeReference<Utf8String>() {
                }, new TypeReference<Utf8String>() {
                }, new TypeReference<Int256>() {
                }));
        List<Type> results = FunctionReturnDecoder.decode(data, function.getOutputParameters());
        return new Tuple8<String, String, String, String, String, String, String, BigInteger>(

                (String) results.get(0).getValue(),
                (String) results.get(1).getValue(),
                (String) results.get(2).getValue(),
                (String) results.get(3).getValue(),
                (String) results.get(4).getValue(),
                (String) results.get(5).getValue(),
                (String) results.get(6).getValue(),
                (BigInteger) results.get(7).getValue()
        );
    }

    public Tuple1<BigInteger> getInsertOutput(TransactionReceipt transactionReceipt) {
        String data = transactionReceipt.getOutput();
        final Function function = new Function(FUNC_INSERT,
                Arrays.<Type>asList(),
                Arrays.<TypeReference<?>>asList(new TypeReference<Int256>() {
                })
        );
        List<Type> results = FunctionReturnDecoder.decode(data, function.getOutputParameters());
        return new Tuple1<BigInteger>(

                (BigInteger) results.get(0).getValue()
        );
    }

    public Tuple2<BigInteger, List<String>> selectByPage(String member_id, String model_id, BigInteger startIndex, BigInteger endIndex) throws ContractException {
        final Function function = new Function(FUNC_SELECTBYPAGE,
                Arrays.<Type>asList(new org.fisco.bcos.sdk.abi.datatypes.Utf8String(member_id),
                        new org.fisco.bcos.sdk.abi.datatypes.Utf8String(model_id),
                        new org.fisco.bcos.sdk.abi.datatypes.generated.Int256(startIndex),
                        new org.fisco.bcos.sdk.abi.datatypes.generated.Int256(endIndex)),
                Arrays.<TypeReference<?>>asList(new TypeReference<Int256>() {
                }, new TypeReference<DynamicArray<Utf8String>>() {
                }));
        List<Type> results = executeCallWithMultipleValueReturn(function);
        return new Tuple2<BigInteger, List<String>>(
                (BigInteger) results.get(0).getValue(),
                convertToNative((List<Utf8String>) results.get(1).getValue()));
    }

    public static BillContract load(String contractAddress, Client client, CryptoKeyPair credential) {
        return new BillContract(contractAddress, client, credential);
    }

    public static BillContract deploy(Client client, CryptoKeyPair credential) throws ContractException {
        return deploy(BillContract.class, client, credential, getBinary(client.getCryptoSuite()), "");
    }
}
